import Head from 'next/head'
import BodyLayout from '../components/Layout/BodyLayout';

const Articles = () => (
  <BodyLayout>
    <Head>
      <title>Articles</title>
      <link rel='icon' href='/favicon.ico' />
    </Head>
      <div>lol</div>
  </BodyLayout>
)

export default Articles;
